import React from 'react';

const recipes = [
  { id: 1, title: 'Butter Chicken' },
  { id: 2, title: 'Paneer Tikka' },
  { id: 3, title: 'Biryani' },
  { id: 4, title: 'Chole Bhature' },
  { id: 5, title: 'Samosa' },
];

const RecipeList = () => {
  return (
    <div>
      <h2>Recipe List</h2>
      <ul>
        {recipes.map((recipe) => (
          <li key={recipe.id}>
            <a href={`/RecipeDetails/${recipe.id}`}>{recipe.title}</a>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default RecipeList;
